import styled from 'styled-components';

export const Wrapper = styled.div `
	padding-top: 10px;
	font-size: 1em;
	height: 100vh;
	width: 100vw;
	position: relative;
	text-align: center;

`;

export const Content = styled.div `
	display: flex;
	flex-direction: column;
	margin-top: 3.5em;
	width: 100%;
	height: 100%;
	background-color: #3776ab;
	float: left;

    .form {
      padding-bottom: 5em;
    }

`;


export const Login = styled.div `
    margin: 20px 0;
    width: 500px;
    float: left;
`;
